{"title":"[Checkpoint] P02 Quality measures / Horizontal resolution","type":"vega","params":{"spec":"{ 
  "$schema": "https://vega.github.io/schema/vega-lite/v2.json",
  "title": "Horizontal resolution (meters)",
  "data": {
    "url": {
      "index": "checkpoint", 
      "body": {
        "_source": ["dqSimpleId", "measureName", "measureValue", "p01", "p02", "cptName", "resourceType", "identifier"],
        "query": {"bool": {"must": [         
            "%dashboard_context-must_clause%",
            {"query_string": {
                "query": "+docType:dqmeasures +measureValue:[* TO *] +measureName:\"Horizontal resolution\""}}]}},
        "sort" : [
          {"dqSimpleId" : {"order": "asc"}},
          {"measureName" : {"order": "asc"}}
        ],
        "size": 100
      }
    },
    "format": {"property": "hits.hits"}
  }, 
  "transform": [
    {"calculate": "datum._source.dqSimpleId", "as": "dqSimpleId"},
    {"calculate": "datum._source.measureName", "as": "measureName"},
    {"calculate": "parseFloat(datum._source.measureValue)", "as": "measureValue"},
    {"calculate": "datum._source.p01", "as": "p01"},
    {"calculate": "datum._source.p02", "as": "p02"},
    {"calculate": "datum._source.cptName", "as": "cptName"},
    {"calculate": "datum._source.resourceType", "as": "resourceType"}
  ],
  "mark": "bar",
  "encoding": {
    "x": {
      "field": "dqSimpleId",
      "type": "ordinal",
      "axis": {
        "title": false,
        "labelBaseline": "top",
        "labelAngle": 90
      }
    },
    "y": {
      "field": "measureValue",
      "type": "quantitative",
      "scale": {"type": "log"},
      "axis": {
        "title": false
      }
    },
   "tooltip": {"field": "dqSimpleId"},
    "color": {
      "field": "resourceType",
      "type": "nominal",
      "legend": {
        "orient": "top"
      }
    },
    //"row": {
    //  "field": "p01", 
    //  "type": "nominal"
    //}
  }
}"},"aggs":[]}

